import React, { useState, useContext, createContext, useEffect } from 'react';
import { MapContainer, TileLayer, GeoJSON } from 'react-leaflet';
import 'leaflet/dist/leaflet.css';
import regionsGeoJSON from './france-regions.json'; // Importez votre fichier GeoJSON

const RegionContext = createContext();

const RegionProvider = ({ children }) => {
  const [regions, setRegions] = useState([]);

  const addRegion = (region) => {
    setRegions((prev) => {
      const existing = prev.find((r) => r.name === region.name);
      if (existing) {
        return prev.map((r) =>
          r.name === region.name ? { ...r, intensity: r.intensity + region.intensity } : r
        );
      }
      return [...prev, region];
    });
  };

  return (
    <RegionContext.Provider value={{ regions, addRegion }}>
      {children}
    </RegionContext.Provider>
  );
};

const Dashboard = () => {
  return (
    <RegionProvider>
      <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
        <h1>Carte des Régions Françaises</h1>
        <RegionForm />
        <RegionMap />
      </div>
    </RegionProvider>
  );
};

const RegionForm = () => {
  const { addRegion } = useContext(RegionContext);
  const [formData, setFormData] = useState({ name: '', intensity: 1 });

  const handleSubmit = (e) => {
    e.preventDefault();
    if (!formData.name.trim() || isNaN(formData.intensity) || formData.intensity < 1) {
      alert("Veuillez fournir un nom valide et une intensité positive.");
      return;
    }

    addRegion({ 
      name: formData.name, 
      intensity: parseInt(formData.intensity, 10) 
    });

    setFormData({ name: '', intensity: 1 });
  };

  return (
    <form onSubmit={handleSubmit} style={{ marginBottom: '20px' }}>
      <input
        type="text"
        placeholder="Nom de la région"
        value={formData.name}
        onChange={(e) => setFormData({ ...formData, name: e.target.value })}
        required
      />
      <input
        type="number"
        placeholder="Intensité"
        value={formData.intensity}
        onChange={(e) => setFormData({ ...formData, intensity: e.target.value })}
        min="1"
        required
      />
      <button type="submit">Ajouter Région</button>
    </form>
  );
};

const RegionMap = () => {
  const { regions } = useContext(RegionContext);
  const [geoJSONKey, setGeoJSONKey] = useState(0);

  useEffect(() => {
    setGeoJSONKey((prevKey) => prevKey + 1);
  }, [regions]);

  const getColor = (regionName, intensity) => {
    // Trouver l'intensité de la région dans le contexte
    const regionData = regions.find(r => r.name.toLowerCase() === regionName.toLowerCase());
    const finalIntensity = regionData ? regionData.intensity : 0;

    // Échelle de couleur basée sur l'intensité
    return finalIntensity > 5 
      ? '#800026' 
      : finalIntensity > 3 
        ? '#BD0026' 
        : finalIntensity > 1 
          ? '#FED976' 
          : '#FFEDA0';
  };

  const onEachFeature = (feature, layer) => {
    const regionName = feature.properties.nom;
    const regionData = regions.find(r => r.name.toLowerCase() === regionName.toLowerCase());
    const intensity = regionData ? regionData.intensity : 0;

    layer.setStyle({ 
      fillColor: getColor(regionName, intensity), 
      fillOpacity: 0.7, 
      color: '#000', 
      weight: 1 
    });

    layer.bindPopup(`
      <strong>${regionName}</strong><br>
      Intensité: ${intensity}
    `);
  };

  return (
    <MapContainer
      style={{ height: '500px', width: '800px' }}
      center={[46.5, 2.5]}
      zoom={5}
    >
      <TileLayer url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png" />
      <GeoJSON 
        key={geoJSONKey} 
        data={regionsGeoJSON} 
        onEachFeature={onEachFeature} 
      />
    </MapContainer>
  );
};

export default Dashboard;
